full_text:
For those wondering about my commitment to not just bipartisanship, but to focusing on the things that really matter to #NV03, here are some receipts. 

@TheLugarCenter ranked me in the top 25% most bipartisan House members.
https://t.co/yHP5lRB3Xh

Orgs. like @studentvets, @americanlegion &amp; @GIBillRights fight every day for our veterans. They agree that overturning the 2019 Borrower Defense rule is best for our vets.

@realdonaldtrump, I sincerely hope you stand with us &amp; sign H.J. Res. 76 into law.
https://t.co/KNOSONGqr6

Since day one, I’ve put my best bipartisan foot forward to get things done for #NV03.

@TheLugarCenter’s #BipartisanIndex ranks me in the top 25% most bipartisan House members &amp; most bipartisan member of the NV House delegation.

Now more than ever, we need to work together. https://t.co/zZNjr3unCY

Great news for student veterans👏👏

@POTUS signed our bipartisan bill, the Student Veteran Coronavirus Response Act, into law. This law will help protect key student veteran benefits during #COVID19. 

Like I've been saying, we'll make it through this by working together. https://t.co/HwtFjuty2D

Today is #DenimDay, a day to stand with survivors of sexual assault, and spread the word about the steps we need to take as a community to combat and prevent all forms of sexual abuse. 

Today, we wear jeans with a purpose. 
@RapeCrisisCtrLV #DenimDayNV2020 https://t.co/W6D8P2q2Vo

